import Employee from "../models/employee";
import Roles from "../models/role";

export const SetEmployee = async (req, res) =>{
    const {
        identification,name,lastName,roles,password,
        leader,prefix,extension,gender,city,address,phone,cellPhone,email
    } = req.body;

    const newEmployee = new Employee({identification,name,lastName,roles,password,
        leader,prefix,extension,gender,city,address,phone,cellPhone,email});


    // if(roles){
    //     const foundRoles =  await Roles.find({name:{$in: roles}})
    //     newEmployee.roles = foundRoles.map(roles => roles._id)
    // }

    const employeeSave = await newEmployee.save();
    res.status(201).json(employeeSave);
}

export const GetEmployees = async (req, res) =>{
    const employees = await Employee.find()
                                            .populate({
                                                path: 'roles',
                                                select: ['name','description'],
                                                populate: { 
                                                    path: 'modules',
                                                    select: ['name','description','options'],
                                                    populate: { 
                                                        path: 'options',
                                                        match: { status: { $in: 'AC' }},
                                                        select: ['name','description','items'],
                                                        populate: { 
                                                            path: 'items',
                                                            match: { status: { $in: 'AC' }},
                                                            select: ['name','description','items'],
                                                            populate: { 
                                                                path: 'items',
                                                                match: { status: { $in: 'AC' }},
                                                                select: ['name','description','items'],
                                                                populate: { 
                                                                    path: 'items',
                                                                    match: { status: { $in: 'AC' }},
                                                                    select: ['name','description','items']
                                                                }
                                                            }
                                                        }
                                                    }
                                                }
                                            });
    res.json(employees);
}

export const GetEmployeeId = async (req, res) =>{
    const employee = await Employee.findById(req.params.employeeId).populate({
                                                                        path: 'roles',
                                                                        select: ['name','description'],
                                                                        populate: { 
                                                                            path: 'modules',
                                                                            select: ['name','description','options'],
                                                                            populate: { 
                                                                                path: 'options',
                                                                                select: ['name','description','parents'],
                                                                                populate: { 
                                                                                    path: 'parents',
                                                                                    select: ['name']
                                                                                }
                                                                            }
                                                                        }
                                                                    });
    res.status(200).json(employee);
}

export const PutEmployeeId = async (req, res) =>{
    const updatedEmployee = await Employee.findByIdAndUpdate(req.params.employeeId, req.body,{
        new : true
    });
    res.status(200).json(updatedEmployee);
}

export const DeleteEmployeeId = async (req, res) =>{
    await Employee.findByIdAndDelete(req.params.employeeId);
    res.status(204).json();
}

