import {Schema, model} from "mongoose";

const roleSchema = new Schema({
    modules:[
        {
            ref :"Module",
            type : Schema.Types.ObjectId
        }
    ],
    name:{
        type:String
    },
    description:{
        type:String
    },
    icon:{
        type:String
    },
    order:{
        type:String
    },
    status:{
        type:String,
        default:'AC'
    },
},
{
    timestamps : true,
    versionKey : false
})


export default model('Role',roleSchema);
